sources.styles/blocks/contact.scss:
.contact {
  &__title {
    margin-bottom: 12px;

    @include onDesktop {
      margin-bottom: 32px;
    }
  }

  &__text {
    margin-bottom: 32px;

    @include onTablet {
      margin-bottom: 20px;
    }

    @include onDesktop {
      margin-bottom: 40px;
    }
  }

  &__input {
    width: 100%;
    border: none;
    border-bottom: 1px solid $c-gray;
    background-color: $c-lightGray;
    color: $c-darkGray2;
    font-family: inherit;
    @extend %input;
    margin-bottom: 24px;
    padding-bottom: 4px;

    @include onDesktop {
      margin-bottom: 32px;
      padding-bottom: 8px;
    }

    &--textarea {
      margin-bottom: 32px;
      resize: none;
      text-transform: none;

      @include onDesktop {
        margin-bottom: 52px;
      }
    }

    &:nth-of-type(3) {
      margin-bottom: 44px;

      @include onDesktop {
        margin-bottom: 60px;
      }
    }

    &::placeholder {
      font-weight: 400;
    }

    &:hover {
      color: $c-black;
      border-color: $c-black;
    }

    &:focus {
      outline: none;
      color: $c-black;
      border-color: $c-black;
    }

    &:-webkit-autofill {
      -webkit-font-feature-settings: normal;
      font-feature-settings: normal;
      background-clip: text;
      -webkit-background-clip: text;
    }

    &:-webkit-autofill:active,
    &:-webkit-autofill:hover,
    &:-webkit-autofill:focus {
      border-color: $c-black;
      -webkit-font-feature-settings: normal;
      font-feature-settings: normal;
      -webkit-text-fill-color: $c-black;
      background-clip: text;
      -webkit-background-clip: text;
    }

    &:invalid:not(:placeholder-shown) {
      color: $c-red;
      border-color: $c-red;
      -webkit-text-fill-color: $c-red;
    }

    &:valid:not(:focus) {
      color: $c-green;
      border-color: $c-green;
      -webkit-text-fill-color: $c-green;
    }
  }

  &__image-box {
    display: none;
    position: relative;
    width: 100%;
    height: 0;

    @include onTablet {
      display: block;
      padding-bottom: 122.29%;
    }

    @include onDesktop {
      height: 548px;
      padding-bottom: 0;
    }
  }

  &__image {
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    object-fit: cover;
    object-position: center;
  }
}

sources.styles/blocks/footer.scss:
.footer {
  background-color: $c-lightGreen;
  color: $c-lightGray;
  padding: 32px 0 40px;

  @include onTablet {
    padding: 32px 0;
  }

  @include onDesktop {
    padding: 60px 0;
  }

  &__list {
    display: flex;
    flex-direction: column;
    justify-items: left;
    align-items: flex-start;

    @include onDesktop {
      flex-direction: row;
      justify-items: center;
      align-items: center;
    }
  }

  &__item {
    margin-bottom: 12px;

    &:last-of-type {
      margin-bottom: 20px;
    }

    @include onTablet {
      margin-bottom: 16px;
    }

    @include onDesktop {
      margin-right: 40px;
      margin-bottom: 0;

      &:last-of-type {
        margin-right: 0;
        margin-bottom: 0;
      }
    }
  }

  &__link {
    @extend %menu;
  }

  &__socials {
    margin-bottom: 40px;

    @include onTablet {
      margin-bottom: 52px;
    }

    @include onDesktop {
      grid-row: 2 / 3;
      margin-bottom: 0;
    }
  }

  &__icon {
    &:first-of-type {
      margin-right: 20px;

      @include onDesktop {
        margin-right: 16px;
      }
    }
  }

  &__contacts {
    @extend %contacts;

    @include onTablet {
      grid-row: 1 / 2;
    }
  }

  &__contact {
    display: inline-block;
    margin-bottom: 12px;

    @include onDesktop {
      margin-bottom: 20px;
    }
  }

  &__text {
    margin-bottom: 40px;

    @include onTablet {
      margin-bottom: 0;
    }

    @include onDesktop {
      margin-bottom: 28px;
    }
  }

  &__copyright {
    @extend %copyright;
    text-align: center;

    @include onTablet {
      text-align: left;
    }

    @include onDesktop {
      &::before {
        content: "Copyright";
        display: inline-block;
      }
    }
  }
}
